import React from 'react';
import SecondaryHeader from './SecondaryHeader';
import Home from './Home';

const Main = () => {
    return (
        <div>
            <div className="ui inverted segment">
                <img className="ui fluid image" src="/programming.jpeg" />
            </div>
            <div className="ui inverted segment">
                <div className="ui grid">
                    <SecondaryHeader />
                    <Home />
                    <i>&#169; 2021 Created by Kareem Sasa</i>
                    <br />
                </div>
            </div>
        </div>
    );
};

export default Main;
